import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  CircularProgress,
  Grid,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@material-ui/core";
// hook
import { useFetch } from "../../../hooks";
// components
import CultrueCards from "./CultureCards";

const useStyles = makeStyles({
  root: {
    md: 16,
  },
});

const ClientCulture = () => {
  const { data, isLoading } = useFetch("/cultures/group");
  const classes = useStyles();
  const cultureCards = data.map((information) => (
    <Grid key={information._id} item xs={12}>
      <Typography variant="h6">{information._id}</Typography>
      <CultrueCards
        countrySource={information._id}
        information={information.data}
      />
    </Grid>
  ));

  return (
    <div>
      <Grid item xs={12}>
        <Grid container spacing={3}>
          {isLoading ? (
            <Grid item xs={12}>
              <CircularProgress />
            </Grid>
          ) : (
            cultureCards
          )}
        </Grid>
      </Grid>
    </div>
  );
};

export default ClientCulture;
